function Search() {
  const { querry, setQuerry } = useState("");
  return (
    <div className="search-bar">
      <input
        placeholder="seach"
        value={querry}
        onChange={(event) => setQuerry(event.target.value)}
      />
      <button href="#">Search</button>
    </div>
  );
}

export default Search;
